public class PrimeNo {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int k=0;
		for(int i=1;i<=7;i++)
		{
			  if(9%i==0)
			  {
				  k++;
			  }
		}
		
		if(k==2)
		{
			System.out.println("no is prime");
		}
		
	}

}
